class AdminAccountType(TextualConvention, Integer32):
    description = 'This field specifies the type of account. The read-write account type allows the user to modify any group settings. The read-only account allows only read-only access to group configuration data. The default is read-write. Changing this value will come into affect only for new login of the user. Currently logged in sessions will not be affected. Read-only account is only applicable for group admin accounts/pool-admin accounts. Group-admins with read-only set cannot modify any settings.'
    status = 'current'
    displayHint = 'd'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2))
